const ConvertDataForLineChart = (dataArray) => {
  const lineChartData = [];

  // Iterar sobre cada matriz de eventos
  dataArray.forEach((eventsArray) => {
    // Iterar sobre os eventos em cada matriz
    eventsArray.forEach((event) => {
      // Adicionar um objeto ao lineChartData com o início e o fim do evento no eixo x e o nome do evento no eixo y
      lineChartData.push({
        x: { start: new Date(event.Start), end: new Date(event.End) },
        y: event.EventType
      });
    });
  });

  return lineChartData;
};

export default ConvertDataForLineChart;
